    false,nt"url": null,nt"notes": "These field notes respond to the need for
    more knowledge about colonial seabirds, a neglected segment of Alaska's natural
    resources. Refuges, research and what was then river basins studies provided personnel
    and resources. The vessel used was the 65-foot Aleutian Tern, a refuge vessel, enroute
    to its summer station in the Aleutian Islands. The crew consisted of George Putney,
    master/engineer; Chris Anderson, cook/deckhand; George Divoky, wildlife biologist
    (Research); and the author, Ed Bailey, from the Aleutian Islands National Wildlife
    Refuge, joined the group at Sand Point on June 8. Alan McCartney an archeologist
    accompanied us.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
